style.css:
/* Personalización de la página de Google */
body {
  background-color: #0c1d2e; /* Fondo azul noche */
}

/* Personalización del buscador */
input[type="text"] {
  background-color: #0c1d2e; /* Fondo azul noche */
  color: #fff; /* Texto en color blanco */
  border: 1px solid #fff; /* Borde blanco */
  border-radius: 20px; /* Bordes redondeados */
  padding: 10px; /* Espacio interno */
}

input[type="submit"] {
  background-color: #fbbc05; /* Color brillante */
  color: #fff; /* Texto en color blanco */
  border: none; /* Sin borde */
  border-radius: 20px; /* Bordes redondeados */
  padding: 10px 20px; /* Espacio interno */
  cursor: pointer; /* Cambia el cursor al pasar por encima */
}

input[type="submit"]:hover {
  background-color: #ea4335; /* Cambia el color brillante al pasar por encima */
}
